const inputdata =
{
    title: 'Create new post',
    url : 'https://jsonplaceholder.typicode.com/posts',
    method: 'POST',
    body: [
            {
                name: 'email',
                type: 'email',
                max: 24,
                min: 3,
            },
            {
                name: 'full-name',
                type: 'text',
                placeholder: 'John Doe',
                required: true,
            },
            {
                name: 'phone',
                pattern: "[0-9]{3}-[0-9]{2}-[0-9]{3}",
                type: 'tel',
            },
        ]
}

export {inputdata};
